import style from "./Card.module.scss";

//  {
//     id: 1,
//     title: "GREYHOUND",
//     about: "Drama, Action | 2020",
//     rate: 4,
//   },

const Card = ({ data }) => {
  return (
      <div className={style.card}>
        <img className={style.image} src={data.image} />
        <div className={style.card_footer}>
          <span className={style.card_title}>{data.title}</span>
        </div>
      </div>
  );
};

export default Card;
